import React from 'react';
import {Link} from 'react-router-dom'
import '../Card.css'
import studentImg from '../images/alumno.png'
import Card from './Card'
import teacherImg from '../images/teacher.jpg'

class MenuPrincipal extends React.Component{
    
  render(){
    return(
        <div className="Menu">
            <h1>Este es el menu principal</h1>
            <Card img={studentImg} titulo={"Alumno"} descripcion={"Haz click aquí si eres un alumno"}/><br/>
            <Card img={teacherImg} titulo={"Profesor"} descripcion={"Haz click aquí si eres un profesor."}/>
            <div>
                <Link to="/catalogo">Catálogo de Profesores</Link>
            </div>
        </div>
    )
  }
}

export default MenuPrincipal;
